  return (
    <div>
      <div>
        HEADER
        <link to='/'>Main Page</link>
      <Link to='/about'>About Page</Link>
      <Link to='/news'>News Page</Link>
      </div>
      <Outlet />
      <div>
        Footer
      </div>
    </div>
  )
}

export default Layout
